window.bookSummaryJSON = "<p>It's out there, it's ALWAYS been out there—just no one believed it.</p> <p>Governments, Black Ops, Rich Businessmen...All want alien tech and some are going to great lengths, illegal lengths, to procure it.</p> <p>Someone went so far as to endanger a young girl's family. A young girl who wrote a letter to the Queen Bitch. Now, those that are searching for the technology will have to deal with TQB.</p> <p>If there is one thing that will get Bethany Anne's attention... It's mistreating the defenseless.</p> <p>Bethany Anne tries to stay out of the world's business, but they just keep doing stupid stuff...</p> <p>Sucks to be them.</p> <p>Performed by Colleen Delany, Emily Beresford, Amanda Forstrom, Mark Harrietha, Wyn Delano, David Cui Cui, Dan Delgado, Christopher Williams, Danny Gavigan, Jacob Yeh, Rose Elizabeth Supan, Mort Shelby, Aure Nash, Anthony Palmini, Sara Matsui-Colby, Zeke Alton, Terence Aselford, Michael Glenn, Scott McCormick, Jonathan Lee Taylor, Bianca Bryan, Stewart Crank, Matthew Bassett, Matthew Schleigh, Steve Wannall, Bradley Foster Smith, JW Rone, Matthew Pauli, Eric Messner, Richard Rohan, Daniel Llaca, Andy Clemence, Christopher Walker, Tyler Hyrchuk, Ken Jackson, Marni Penning, Rana Kay, Keval Shah, Rayner Gabriel, James Lewis, Tia Shearer, Stephon Walker, Rob McFadyen, Tony Nam, Karen Novack, David Engel, Stephanie Nemeth-Parker, Michael John Casey, Nanette Savard, Jeri Marshall, Catherine Aselford, and Yasmin Tuazon.</p>"; 
